<h3><a href="http://reference.wolfram.com/mathematica/ref/DeleteDuplicates.html">DeleteDuplicates</a></h3>
<ul>
    <li>DeleteDuplicates[<em>list</em>] deletes all duplicates from <em>list</em>.
    <li>DeleteDuplicates[<em>list</em>,<em>test</em>] applies <em>test</em> to pairs of elements to determine whether
        they should be considered duplicates.
</ul><p><b>Attributes:</b> Protected</p><p><b>Symbol has no options.</b></p>
